import "./App.css";

import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Screens/Home";
function App() {
  return <>
          <BrowserRouter>
          <Routes>

            <Route path="/" element={<Home/>}/>
            {/* <Route path="/" element={<About/>}/>
            <Route path="/" element={<Home/>}/> */}
          </Routes>

          </BrowserRouter>

  </>;
}

export default App;
